import { gql } from '@apollo/client';
import { TodoUnit, Todo } from './types';
import { client } from '../../configuration/GraphQL';

const imgs = [
  'data:image/jpeg;base64,',
  'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRxQj1ii5I3JW0fhYoMrjCOwSDT4gz969fQKQ&usqp=CAU',
  'data:image/jpeg;base64,',
];

type TodoFromApi = {
  id: string;
  title: string;
};

export class GraphQLTodoUnit implements TodoUnit {
  Fetch(): Promise<Todo[]> {
    return client.query({
      query: gql`
        query(
          $options: PageQueryOptions
        ) {
          todos(options: $options) {
           data {
              id,
              title,
            }
          }
        }
      `,
      variables: {
        options: {
          slice: {
            start: 0,
            end: 10,
            limit: 10,
          },
        },
      },
    })
      .then((res) => res.data.todos.data
        .map((todo: TodoFromApi) => ({
          id: todo.id,
          title: todo.title,
          img: imgs[Math.random() * 3],
        })))
      .catch(() => [{
        id: 'none',
        imgUrl: 'data:image/png;base64,',
        title: 'error!',
      }]);
  }
}
